import React from "react";
import { Navbar, Container, Nav, Button } from "react-bootstrap";
import "./Header.css"; // подключаем кастомные стили для Header

const Header = () => {
  return (
    <Navbar bg="light" expand="lg" className="custom-header">
      <Container>
        <Navbar.Brand href="/">Mashina.kg</Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="ms-auto align-items-center">
            <Nav.Link href="/bazar">Bazar.kg</Nav.Link>
            <Nav.Link href="/house">House.kg</Nav.Link>
            <Button variant="outline-primary" className="mx-2">
              Вход
            </Button>
            <Button variant="primary">Регистрация</Button>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
};

export default Header;
